import React from "react";
import styled from "styled-components";
export default function Navbar() {
  return (
    <div>
      <Nav>
        <Logo>
          <img src="/Images/HospitalLogo.png" alt="MyHospitalWebsite" />
        </Logo>
        <NavItem>
          <a href="/treatments">
            <img src="/Images/treatmenticon.png" alt="MyhospitalWebsite" />
            <span>Treatments</span>
          </a>
          <a href="/treatments">
            <img src="/Images/foundation.png" alt="MyhospitalWebsite" />
            <span>Foundations</span>
          </a>
          <a href="/treatments">
            <img src="/Images/abouticon.png" alt="MyhospitalWebsite" />
            <span>About</span>
          </a>
          <a href="/treatments">
            <img src="/Images/newsicon.png" alt="MyhospitalWebsite" />
            <span>News</span>
          </a>
          <a href="/treatments">
            <img src="/Images/eventicon.png" alt="MyhospitalWebsite" />
            <span>Event</span>
          </a>
          <a href="/treatments">
            <img src="/Images/contacticon.png" alt="MyhospitalWebsite" />
            <span>Contact</span>
          </a>
          <a href="/treatments">
            <img src="/Images/carrericon.png" alt="MyhospitalWebsite" />
            <span>Carrer</span>
          </a>
          <a href="/treatments">
            <img src="/Images/donateicon.png" alt="MyhospitalWebsite" />
            <span>Donate</span>
          </a>
          <a href="/treatments">
            <img src="/Images/searchicon.png" alt="MyhospitalWebsite" />
            <span>Search</span>
          </a>
        </NavItem>
      </Nav>
    </div>
  );
}

const Nav = styled.nav`
  border: 2px solid green;
  position: fixed;
  top: 0%;
  left: 0%;
  width: 100%;
  z-index: -3;
  display: flex;
  flex-direction: row;
  align-items: center;
  justify-content: space-between;
  background-color: #090b13;
`;

const Logo = styled.a`
  img {
    width: 140px;
    border: 2px solid green;
  }
`;

const NavItem = styled.div`
  border: 2px solid grey;
  display: flex;
  flex-direction: row;
  align-items: center;
  justify-content: center;
  a {
    display: flex;
    flex-direction: row;
    align-items: center;
    padding: 0 16px;
    text-decoration: none;
    img {
      border: 2px solid pink;
      width: 30px;
      filter: invert(100%);
    }
    span {
      color: rgb(249, 249, 249);
      font-size: 20px;
      padding: 2px 0px;
      letter-spacing: 1.42px;
      line-height: 1.08;
    }
  }
`;
